import React from 'react';

const Cart = ({ cart }) => {
  return (
    <div>
      <h2>Keranjang Belanja</h2>
      {cart.length === 0 ? (
        <p>Keranjang belanja Anda kosong</p>
      ) : (
        <ul>
          {cart.map((item, index) => (
            <li key={index}>
              {item.name} - Rp {item.price} per kg
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Cart;
